import React from 'react';

import { Text, View, Image } from 'react-native';

function KatsItem ({preview, name}) {



	return (
		<View>
						<Image
			              	source={{
			                width: 200,
			                height: 200,
			                uri: preview}}
			              />
			              <Text>
							{name}	
						 </Text>
		</View>

	)
}

export default KatsItem;
